// src/admin/DoctorDashboard.js
import React, { useEffect, useState } from "react";
import { getData } from "../api"; // Assure-toi que src/api/index.js existe

const DoctorDashboard = () => {
  const [patients, setPatients] = useState([]);

  useEffect(() => {
    const fetchPatients = async () => {
      try {
        const data = await getData("/patients"); // ton endpoint backend
        setPatients(data);
      } catch (err) {
        console.error("Erreur récupération patients:", err);
      }
    };
    fetchPatients();
  }, []);

  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold mb-4">Dashboard Médecin</h1>
      <table className="min-w-full border border-gray-300">
        <thead>
          <tr>
            <th className="border px-4 py-2">Nom</th>
            <th className="border px-4 py-2">Email</th>
            <th className="border px-4 py-2">Actions</th>
          </tr>
        </thead>
        <tbody>
          {patients.map((patient) => (
            <tr key={patient._id}>
              <td className="border px-4 py-2">{patient.username}</td>
              <td className="border px-4 py-2">{patient.email}</td>
              <td className="border px-4 py-2">
                <button className="bg-blue-500 text-white px-2 py-1 mr-2">Edit</button>
                <button className="bg-red-500 text-white px-2 py-1">Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default DoctorDashboard;
